@axf:spread-page-master@　に @fo:region-body@　を再定義するために役に立つであることが行っている場合は、次のようである。
*@fo:region-body@　を写すことは簡単でなければならないことになっています。。
*@axf:spread-page-master@　が参照している　@fo:simple-page-master@　の変化に弾力でなければならないことになっています。。

@axf:spread-page-master@　に @fo:region-body@　を再定義するために役に立つであることが行っている場合は、次のようである。
*@fo:region-body@　を写すことは簡単でなければならないことになっています。
*@axf:spread-page-master@　が参照している　@fo:simple-page-master@　の変化に弾力でなければならないことになっています。
